import styled from "styled-components";

export const Container = styled.div` background-color:#FAFAFA`

export const TypeDiv = styled.div`width:100%
height:33%`

export const DishType = styled.p`
                                justify-content:center;
                                font-family:'sans-serif;`

export const SpicyLogo = styled.img`width: 20%;
    height: 20px;`
    SpicyLogo.defaultProps = {
    src: "./assets/Spicy.svg",
  };

  export const VegitarianLogo = styled.img`width: 20%;
    height: 20%;`
    VegitarianLogo.defaultProps = {
    src: "./assets/Vegitarian.svg",
  };

  export const VeganLogo = styled.img`width: 20%;
    height: 20%;`
